import React from 'react';


const TableForm = (props) => {

  const partySize = [1,2,3,4,5];
  partySize.map((size) => {
    return(
      <option value={size} key={size}>{size}</option>
    )
  });


    return(
      <>
        <h2>Available Tables</h2>
        <form>
          <select>
            {partySize}
          </select>
        </form>
      </>
    );
};
export default TableForm;
